  false,\n\t\"url\": null,\n\t\"notes\": \"A SMART Tool and User's Guide for aiding
  NWRS Station staff when prioritizing their surveys for an Inventory and Monitoring
  Plan. This guide describes a process and a tool that can be used to prioritize surveys.
  The tool is a spreadsheet that uses a simple, multi-attribute ranking technique
  (SMART) which can be used for the Inventory and Monitoring Plan decision making
  process for refuge surveys. User's evaluate the surveys using scores from up to
  24 criteria, which use weights of relative importance assinged at the onset of the
  prioritization process. The tool and approach can be used to help resolve differing
  opinions regarding the relative importance of each survey. The discussion surrounding
  the scores to enter into the tool for each criterion will require survey evaluators
  to think carefully about the details of each survey and provide a means for attaining
  a group decision.  Final prioritization scores provide the platform information
  for selecting a subset of surveys submitted to the station's Inventory and Monitoring
  Plan.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
